webpackJsonp([0xc1f6fe950e96],{631:function(e,a){e.exports={pathContext:{docHtml:'<h1 id="streams"><a href="#streams" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Streams</h1>\n<p>A Stream Gateway basically listens to messages on a message queue.</p>\n<p>The configuration for an event source is somewhat similar between all stream gateways. We will go through setup of NATS gateway.</p>\n<h2 id="nats"><a href="#nats" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>NATS</h2>\n<p>NATS gateway consumes messages by subscribing to NATS topic.</p>\n<h3 id="how-to-define-an-event-source-in-confimap"><a href="#how-to-define-an-event-source-in-confimap" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>How to define an event source in confimap?</h3>\n<p>An entry in the gateway configmap corresponds to <a href="https://github.com/argoproj/argo-events/blob/39fd5b8592e27c869dcc6cf2b0e6fee1d56622f2/gateways/core/stream/nats/config.go#L33-L40">this</a>.</p>\n<p>If you don\'t provide an explicit <code>Backoff</code>, then gateway will use a default backoff in case of connection failure.</p>\n<p>The <a href="../../examples/gateways/nats-gateway-configmap.yaml">event source</a> contains information to subscribe to topic <code>foo</code>, it also contains an explicit backoff option\nin case of the connection failure.</p>\n<h3 id="setup"><a href="#setup" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Setup</h3>\n<p><strong>1. Install <a href="../../examples/event-sources/nats.yaml">Event Source</a></strong></p>\n<p><strong>2. Install <a href="../../examples/gateways/nats.yaml">Gateway</a></strong></p>\n<p>Make sure the gateway pod is created.</p>\n<p><strong>3. Install <a href="../../examples/sensors/nats.yaml">Sensor</a></strong></p>\n<p>Make sure the sensor pod is created</p>\n<p><strong>4. Trigger Workflow</strong></p>\n<p>Publish message to subject <code>foo</code>.\nYou might find this useful <a href="https://github.com/nats-io/go-nats/tree/master/examples/nats-pub">https://github.com/nats-io/go-nats/tree/master/examples/nats-pub</a></p>',docPath:"argo-events/docs/gateways/streams",proj:"argo-events"}}}});
